ionInvalidDataPartition": { "description": "Action details for invalid or unsupported partitions detected by discovery.", "id": "GoogleCloudDataplexV1ActionInvalidDataPartition", "properties": { "expectedStructure": { "enumDescriptions": [ "PartitionStructure unspecified.", "Consistent hive-style partition definition (both raw and curated zone).", "Hive style partition definition (curated zone only)." ], "description": "The issue type of InvalidDataPartition.", "type": "string", "enum": [ "PARTITION_STRUCTURE_UNSPECIFIED", "CONSISTENT_KEYS", "HIVE_STYLE_KEYS" ] } }, "type": "object" }, "GoogleCloudDataplexV1ListActionsResponse": { "type": "object", "description": "List actions response.", "id": "GoogleCloudDataplexV1ListActionsResponse", "properties": { "actions": { "items": { "$ref": "GoogleCloudDataplexV1Action" }, "description": "Actions under the given parent lake/zone/asset.", "type": "array" }, "nextPageToken": { "type": "string", "description": "Token to retrieve the next page of results, or empty if there are no more results in the list." } } }, "GoogleCloudDataplexV1DiscoveryEventConfigDetails": { "id": "GoogleCloudDataplexV1DiscoveryEventConfigDetails", "description": "Details about configuration events.", "type": "object", "properties": { "parameters": { "type": "object", "additionalProperties": { "type": "string" }, "description": "A list of discovery configuration parameters in effect. The keys are the field paths within DiscoverySpec. Eg. includePatterns, excludePatterns, csvOptions.disableTypeInference, etc." } } }, "GoogleCloudDataplexV1LakeMetastore": { "id": "GoogleCloudDataplexV1LakeMetastore", "properties": { "service": { "description": "Optional. A relative reference to the Dataproc Metastore (https://cloud.google.com/dataproc-metastore/docs) service associated with the lake: projects/{project_id}/locations/{location_id}/services/{service_id}", "type": "string" } }, "description": "Settings to manage association of Dataproc Metastore with a lake