nly. Provides additional detail if the entity is incompatible with the metadata store.", "readOnly": true } }, "id": "GoogleCloudDataplexV1EntityCompatibilityStatusCompatibility", "description": "Provides compatibility information for a specific metadata store." }, "GoogleCloudDataplexV1StorageFormatJsonOptions": { "description": "Describes JSON data format.", "id": "GoogleCloudDataplexV1StorageFormatJsonOptions", "properties": { "encoding": { "type": "string", "description": "Optional. The character encoding of the data. Accepts \"US-ASCII\", \"UTF-8\" and \"ISO-8859-1\". Defaults to UTF-8 if not specified." } }, "type": "object" }, "GoogleCloudDataplexV1EntityCompatibilityStatus": { "id": "GoogleCloudDataplexV1EntityCompatibilityStatus", "type": "object", "description": "Provides compatibility information for various metadata stores.", "properties": { "hiveMetastore": { "description": "Output only. Whether this entity is compatible with Hive Metastore.", "$ref": "GoogleCloudDataplexV1EntityCompatibilityStatusCompatibility", "readOnly": true }, "bigquery": { "description": "Output only. Whether this entity is compatible with BigQuery.", "$ref": "GoogleCloudDataplexV1EntityCompatibilityStatusCompatibility", "readOnly": true } } }, "GoogleLongrunningListOperationsResponse": { "description": "The response message for Operations.ListOperations.", "id": "GoogleLongrunningListOperationsResponse", "properties": { "operations": { "description": "A list of operations that matches the specified filter in the request.", "type": "array", "items": { "$ref": "GoogleLongrunningOperation" } }, "nextPageToken": { "type": "string", "description": "The standard List next-page token." } }, "type": "object" }, "GoogleCloudDataplexV1AssetDiscoveryStatusStats": { "description": "The aggregated data statistics for the asset reported by discovery.", "type": "object", "id": "GoogleCloudDataplexV1AssetDiscoveryStatusStats", "properties": { "tables": { "type": "string", "format": "int64", "de