tion mark) or ''' (single quotation mark). Defaults to '\"' (double quotation mark) if unspecified.", "type": "string" }, "encoding": { "type": "string", "description": "Optional. The character encoding of the data. Accepts \"US-ASCII\", \"UTF-8\", and \"ISO-8859-1\". Defaults to UTF-8 if unspecified." }, "delimiter": { "description": "Optional. The delimiter used to separate values. Defaults to ','.", "type": "string" }, "headerRows": { "type": "integer", "format": "int32", "description": "Optional. The number of rows to interpret as header rows that should be skipped when reading data rows. Defaults to 0." } } }, "GoogleCloudDataplexV1ZoneDiscoverySpecJsonOptions": { "id": "GoogleCloudDataplexV1ZoneDiscoverySpecJsonOptions", "description": "Describe JSON data format.", "properties": { "disableTypeInference": { "type": "boolean", "description": "Optional. Whether to disable the inference of data type for Json data. If true, all columns will be registered as their primitive types (strings, number or boolean)." }, "encoding": { "type": "string", "description": "Optional. The character encoding of the data. The default is UTF-8." } }, "type": "object" }, "GoogleCloudDataplexV1ActionInvalidDataOrganization": { "type": "object", "description": "Action details for invalid data arrangement.", "properties": {}, "id": "GoogleCloudDataplexV1ActionInvalidDataOrganization" }, "GoogleCloudDataplexV1ListZonesResponse": { "id": "GoogleCloudDataplexV1ListZonesResponse", "properties": { "zones": { "description": "Zones under the given parent lake.", "items": { "$ref": "GoogleCloudDataplexV1Zone" }, "type": "array" }, "nextPageToken": { "type": "string", "description": "Token to retrieve the next page of results, or empty if there are no more results in the list." } }, "description": "List zones response.", "type": "object" }, "GoogleCloudDataplexV1EnvironmentInfrastructureSpecOsImageRuntime": { "id": "GoogleCloudDataplexV1EnvironmentInfrastructureSpecOsImageRuntime", "type": "objec